import React, { useState } from 'react';
import '../../../src/assets/css/contact.css'

function ContactUsForm() {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [orgName, setOrgName] = useState('');
    const [service, setService] = useState('');
    const [message, setMessage] = useState('');

    return (
      <div>
        <div className="lets-work-title">Let's create your project</div>


        <form className="form-container">
          <label className = "lablel">Your name?</label>
          <input className = "input"
            placeholder="fahima farook"
            type="text"
            value={name}
            onChange={(e) => {
              setName(e.target.value);
            }}
          />


        <div className="horizontal-line"></div>
        <label className = "lablel">your mailId?</label>
          <input className = "input"
            placeholder="fahimafarook510@gmail.com"
            type="text"
            value={email}
            onChange={(e) => {
                setEmail(e.target.value);
            }}
          />

        <div className="horizontal-line"></div>
        <label className = "lablel">name of your organisation?</label>
          <input className = "input"
            placeholder="unicron"
            type="text"
            value={orgName}
            onChange={(e) => {
                setOrgName(e.target.value);
            }}
          />   

          <div className="horizontal-line"></div>
          <label className = "lablel">the service your looking for?</label>
          <input className = "input"
            placeholder="website building, web application building"
            type="text"
            value={service}
            onChange={(e) => {
              setService(e.target.value);
            }}
          /> 

        <div className="horizontal-line"></div>
        <label className = "lablel">ur message?</label>
          <input className = "input"
            placeholder="website building, web application building"
            type="text"
            value={message}
            onChange={(e) => {
              setMessage(e.target.value);
            }}
          /> 


        </form>
      </div>
    );
  }

export default ContactUsForm;
